    //     downVotes: 2,
    //     noOfAnswers: 0,
    //     questionTitle: 'What is a function?',
    //     questionBody: "It meant to be",
    //     questionTags: ["javascript", "R", "python"],
    //     userPosted: 'mano',
    //     userId: 1,
    //     askedOn: "jan 1",
    //     answer: [{
    //       answerBody: "Answer",
    //       userAnswered: 'kumar',
    //       answeredOn: 'jan 2',
    //       userId: 2,
